export const AddComponent = (Component) => ({
    type: 'ADD_MORE',
    Component: Component
  });

export const SET_BRIGHTNESS = (brightness) => ({
  type: 'SET_BRIGHTNESS',
  brightness: brightness
});

export const SET_BLINK_PS = (countblink) => ({
  type: 'SET_BLINK_PS',
  countblink: countblink
});

export const SET_TIME = (TIME) => ({
  type: 'SET_TIME',
  TIME: TIME
});

export const ENABLE_OPTIONS = () => ({
  type: 'ENABLE_OPTIONS_TRAFIC',

});
